import React from 'react';
import "./App.css";


function App() {
    return (
        <>
       <div className="bitron_main">
      <div className="smart"> <p>SMART</p>
       <div className="vrtl">line</div>
       </div>
       
      <div className="bi"> <h1>BI</h1></div>
      <div className="tron"> <h1>TRON</h1></div>
      

      <div className="vrtl2">
      <div>
      <p>CONTRACT</p>
      </div>
      </div>

      
      
       </div>
       </>
    )
}

export default App;
